import React, { useState, useEffect } from "react";
import axios from "axios";
import { Container, Form, Button, Table, Alert } from "react-bootstrap";

const Dashboard = () => {
  const [patients, setPatients] = useState([]);
  const [newPatient, setNewPatient] = useState({
    name: "",
    age: "",
    gender: "",
    address: "",
    contact: "",
    wardNumber: "",
    status: ""
  });
  const [message, setMessage] = useState("");

  useEffect(() => {
    fetchPatients();
  }, []);

  const fetchPatients = async () => {
    try {
      const response = await axios.get("http://localhost:5000/api/patients", {
        headers: { Authorization: `Bearer YOUR_ADMIN_TOKEN` },
      });
      setPatients(response.data);
    } catch (error) {
      console.error("Error fetching patients", error);
    }
  };

  const registerPatient = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5000/api/patients/register", newPatient, {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer YOUR_ADMIN_TOKEN`,
        },
      });
      setMessage(response.data.message);
      fetchPatients();
    } catch (error) {
      console.error("Error registering patient", error);
    }
  };

  return (
    <Container>
      <h2 className="my-4">Admin Dashboard</h2>
      {message && <Alert variant="success">{message}</Alert>}
      <h4>Register Patient</h4>
      <Form onSubmit={registerPatient}>
        <Form.Group>
          <Form.Label>Name</Form.Label>
          <Form.Control type="text" onChange={(e) => setNewPatient({...newPatient, name: e.target.value})} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Age</Form.Label>
          <Form.Control type="number" onChange={(e) => setNewPatient({...newPatient, age: e.target.value})} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Gender</Form.Label>
          <Form.Control as="select" onChange={(e) => setNewPatient({...newPatient, gender: e.target.value})} required>
            <option value="">Select</option>
            <option value="Male">Male</option>
            <option value="Female">Female</option>
          </Form.Control>
        </Form.Group>
        <Form.Group>
          <Form.Label>Address</Form.Label>
          <Form.Control type="text" onChange={(e) => setNewPatient({...newPatient, address: e.target.value})} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Contact</Form.Label>
          <Form.Control type="text" onChange={(e) => setNewPatient({...newPatient, contact: e.target.value})} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Ward Number</Form.Label>
          <Form.Control type="text" onChange={(e) => setNewPatient({...newPatient, wardNumber: e.target.value})} required />
        </Form.Group>
        <Form.Group>
          <Form.Label>Status</Form.Label>
          <Form.Control type="text" onChange={(e) => setNewPatient({...newPatient, status: e.target.value})} required />
        </Form.Group>
        <Button type="submit" className="mt-2">Register</Button>
      </Form>
      <h4 className="mt-4">All Patients</h4>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Name</th>
            <th>Age</th>
            <th>Gender</th>
            <th>Contact</th>
            <th>Address</th>
            <th>Ward Number</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {patients.map((patient) => (
            <tr key={patient._id}>
              <td>{patient.name}</td>
              <td>{patient.age}</td>
              <td>{patient.gender}</td>
              <td>{patient.contact}</td>
              <td>{patient.address}</td>
              <td>{patient.wardNumber}</td>
              <td>{patient.status}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Container>
  );
};

export default Dashboard;
